import React, { Component } from "react";
import "./lawtimesheet.css";
import Axios from "axios";
import ReactTable from "react-table";
import "react-table/react-table.css";

class lawtimesheet extends Component {
  constructor(props) {
    super(props);
    this.state = {
      sheet: [],
    };
  }

  componentDidMount = () => {
    Axios.get("/reportsforalltIimeSheet").then((response) => {
      this.setState({
        sheet: response,
      });
    });
  };

  render() {
    const { sheet } = this.state;
    console.log("sheet", sheet);
    const columns = [
      {
        Header: "ID",
        accessor: "employeeID",
        sortable: false,
        style: {
          textAlign: "center",
        },
        width: 70,
        maxWidth: 100,
        minWidth: 70,
      },
      {
        Header: "ID",
        accessor: "barGrading",
        sortable: false,
        style: {
          textAlign: "center",
        },
        width: 70,
        maxWidth: 100,
        minWidth: 70,
      },
      {
        Header: "Date",
        accessor: "p_Date",
        sortable: false,
        width: 70,
      },
      {
        Header: "End Time",
        accessor: "End Time",
        sortable: false,
        width: 100,
      },
      {
        Header: "Start Time",
        accessor: "p_Start",
        sortable: true,
        width: 120,
        maxWidth: 150,
      },
      {
        Header: "Project Name",
        accessor: "project_Name",
        sortable: true,
        width: 150,
        maxWidth: 150,
      },
    ];

    return (
      <div>
        <ReactTable columns={columns}></ReactTable>
      </div>
    );
  }
}

export default lawtimesheet;
